import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import PlaneModelList from './components/PlaneModel';
import PilotList from './components/Pilot';
import AddressList from './components/Address';
import FlightDescriptionList from './components/FlightDescription';
import FlightList from './components/Flight';
import PlaneList from './components/Plane';
import CertificateList from './components/Certificate';
import AirportList from './components/Airport';

// 

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
             React
          </a>
        </header>
        <PlaneModelList/>
        <PilotList/>
        <AddressList/>
        <FlightDescriptionList/>
        <FlightList/>
        <PlaneList/>
        <CertificateList/>
        <AirportList/>
      </div>
    );
  }
}


export default App;
